import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  Button,
  Select,
  MenuItem,
  Box
} from '@mui/material';

const AdminOrders = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = async () => {
    try {
      const response = await axios.get('http://localhost:8080/api/orders');
      setOrders(response.data);
    } catch (error) {
      console.error('Error fetching orders:', error);
    }
  };

  const handleStatusChange = async (orderId, newStatus) => {
    try {
      await axios.put(`http://localhost:8080/api/orders/${orderId}/status`, newStatus, {
        headers: {
          'Content-Type': 'text/plain'
        }
      });
      // Recargar las órdenes después de actualizar
      await fetchOrders();
    } catch (error) {
      console.error('Error updating order status:', error);
    }
  };

  const getNextStatus = (currentStatus) => {
    const statusFlow = {
      'REALIZADO': 'PAGADO',
      'PAGADO': 'ENVIADO',
      'ENVIADO': 'RECIBIDO'
    };
    return statusFlow[currentStatus] || currentStatus;
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('es-AR', {
      year: 'numeric',
      month: 'long',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  return (
    <Box sx={{ padding: '20px' }}>
      <Typography variant="h4" gutterBottom>
        Administrar Pedidos
      </Typography>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Número de Pedido</TableCell>
              <TableCell>Usuario</TableCell>
              <TableCell>Fecha</TableCell>
              <TableCell>Estado</TableCell>
              <TableCell>Total</TableCell>
              <TableCell>Productos</TableCell>
              <TableCell>Acciones</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {orders.map((order) => (
              <TableRow key={order.id}>
                <TableCell>#{order.id}</TableCell>
                <TableCell>{order.user.username}</TableCell>
                <TableCell>{formatDate(order.createdAt)}</TableCell>
                <TableCell>
                  <Select
                    value={order.status}
                    onChange={(e) => handleStatusChange(order.id, e.target.value)}
                    disabled={order.status === 'RECIBIDO'}
                    sx={{ minWidth: 120 }}
                  >
                    <MenuItem value="REALIZADO">REALIZADO</MenuItem>
                    <MenuItem value="PAGADO">PAGADO</MenuItem>
                    <MenuItem value="ENVIADO">ENVIADO</MenuItem>
                    <MenuItem value="RECIBIDO">RECIBIDO</MenuItem>
                  </Select>
                </TableCell>
                <TableCell>${order.total}</TableCell>
                <TableCell>
                  {order.items.map(item => (
                    <Box key={item.id} sx={{ marginBottom: '4px' }}>
                      • {item.productName} x {item.quantity}
                    </Box>
                  ))}
                </TableCell>
                <TableCell>
                  {order.status !== 'RECIBIDO' && (
                    <Button
                      variant="contained"
                      color="primary"
                      onClick={() => handleStatusChange(order.id, getNextStatus(order.status))}
                    >
                      Avanzar Estado
                    </Button>
                  )}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default AdminOrders;
